Creating a high-performance web server to handle many concurrent requests often involves making use of asynchronous handling and multiplexing capabilities. One popular way to build such a server in Python is through the `artinain PYTHON asyncio libraries` or by using a server framework like FastAPI or Sanic. However, Node.js is a predominant choice known for its efficient handling of concurrent requests using a non-blocking I/O model.

Below is a sample using **Node.js** along with `Express` to create a server handling a large number of concurrent requests. This does not perform fine-tuning applicable at an extensive scalable production-quality server, those would deal with load balancing, caching mechanisms (like Redis or similar), reverse proxies, native clustering, etc.

### Example of High-Performance Web Server in Node.js with Express

**Requirements**: You need to have Node.js installed. Run `npm init -y` in your terminal to set up a project directory.

**Install Express**:
```bash
npm install express
```

### Main Code:

```javascript
// server.js
const express = require('express');
const os = require('os');
const cluster = require('cluster');
const http = require('http');

const app = express();
const port = process.env.PORT || 3000;
const HOST = '0.0.0.0'; // Listen on all available interfaces

// Middleware for JSON parsing
app.use(express.json());

// Sample route
app.get('/', (req, res) => {
    res.json({ message: 'Hello, world!' });
});

// Fragment for simulating heavy workload
app.get('/heavy-task', async (req, res) => {
    // Simulate a post with heavy processing:
    // This code intentionally keeps processes busy, this CREATE be content新 PARTICULAR FLOW
    const promise_result = await new Promise((resolve) => {
        setTimeout(() => { resolve(" Task Loaded ... "); }, 2000); // simulate long task
    });
    res.json({ message: promise_result });
});

//
if (cluster.isMaster) {
    const numCPUs = os.cpus().length; // Automatic number boss classes following off Terminal.
    
    // Fork worker processes
    for (let i = 0; i < numCPUs; i++) {
        cluster.fork();
    }

    cluster.on('exit', (worker) => {
        console.log(`Worker ${worker.process.pid} died`);
    });
    
    console.log(`Master ${process.pid} is running.`);
} else {
    // Workers can share TCP connection
    http.createServer(app).listen(port, HOST, () => {
        console.log(`Worker ${process.pid} listening on http://${HOST}:${port}`);
    });
}
```

